import React, { Component } from "react";
import "./App.css";
import "./Navbar";
import Navbar from "./Navbar";

class App extends Component {
  constructor(props) {
    // super(props);
    this.state = {
      account: "0x0W3WRH34J4J2NFF",
    };
  }
  render() {
    return (
      <div>
        <Navbar account={this.state.account} />
        <div className="text-center">
          <h1>Hello world</h1>
        </div>
      </div>
    );
  }
}

export default App;
